import React, { useState } from 'react';


export const PhotoUploadForm = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [imagePath, setImagePath] = useState('');
  const [caption, setCaption] = useState('');
  const [altText, setAltText] = useState('');
  const [disableLikesAndViews, setDisableLikesAndViews] = useState(false);
  const [disableComments, setDisableComments] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const formData = new FormData();
      formData.append('username', username);
      formData.append('password', password);
      formData.append('image_path', imagePath);
      formData.append('caption', caption);
      formData.append('alt_text', altText);
      formData.append('disable_likes_and_views', disableLikesAndViews ? '1' : '0');
      formData.append('disable_comments', disableComments ? '1' : '0');

      const response = await fetch('/upload_photo', {
        method: 'POST',
        body: formData,
      });

      if (response.ok) {
        const data = await response.json();
        console.log('Media ID:', data.media_id);
      } else {
        const error = await response.json();
        console.error('Error:', error.error);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (

    <div className="container my-5">
    <h1 className="text-center mb-4">Upload Photo</h1>
    <div className="card rounded-3 p-4">
      <form onSubmit={handleSubmit}>
        <div className="row mb-3">
          <div className="col">
            <label htmlFor="username" className="form-label">Username:</label>
            <input
              type="text"
              id="username"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              className="form-control"
            />
          </div>
          <div className="col">
            <label htmlFor="password" className="form-label">Password:</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="form-control"
            />
          </div>
        </div>
        <div className="row mb-3">
          <div className="col">
            <label htmlFor="imagePath" className="form-label">Image Path:</label>
            <input
              type="text"
              id="imagePath"
              value={imagePath}
              onChange={(e) => setImagePath(e.target.value)}
              className="form-control"
            />
          </div>
        </div>
        <div className="row mb-3">
          <div className="col">
            <label htmlFor="caption" className="form-label">Caption:</label>
            <input
              type="text"
              id="caption"
              value={caption}
              onChange={(e) => setCaption(e.target.value)}
              className="form-control"
            />
          </div>
          <div className="col">
            <label htmlFor="altText" className="form-label">Alt Text:</label>
            <input
              type="text"
              id="altText"
              value={altText}
              onChange={(e) => setAltText(e.target.value)}
              className="form-control"
            />
          </div>
        </div>
        <div className="form-check mb-3">
          <input
            className="form-check-input"
            type="checkbox"
            checked={disableLikesAndViews}
            onChange={(e) => setDisableLikesAndViews(e.target.checked)}
            id="disableLikesAndViews"
          />
          <label className="form-check-label" htmlFor="disableLikesAndViews">
            Disable Likes and Views
          </label>
        </div>
        <div className="form-check mb-3">
          <input
            className="form-check-input"
            type="checkbox"
            checked={disableComments}
            onChange={(e) => setDisableComments(e.target.checked)}
            id="disableComments"
          />
          <label className="form-check-label" htmlFor="disableComments">
            Disable Comments
          </label>
        </div>
        <div className="text-center">
          <button type="submit" className="btn btn-primary">Upload Photo</button>
        </div>
      </form>
    </div>
    <footer className="text-center mt-4">
      &copy; 2024 - Photo Upload Tool
    </footer>
  </div>
  );
}
